import "./App.css";

function App() {
  return (
    <div className="App">
      <img src="/src/image/00_grab.jpg" alt='image'/>
      <img src="image/00_grab.jpg" alt='image'/>
      <img src={process.env.PUBLIC_URL + '/image/00_grab.jpg'} />
    </div>
  );
}

export default App;
